import './PasswordSetting.css'
function PasswordSettings () {


    return(
        <div>
            <div>
            <div>
                <label>Change password:</label>   
            </div>
            
            <input type="text" className="passStyle" placeholder="change password..." />
            </div>
            
        </div>
    )
}

export default PasswordSettings;
